// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract CarbonCredit {

    // Struct to define a carbon credit
    struct Credit {
        uint256 id;
        string description;
        uint256 amount; // Amount of carbon credits in units (e.g., tons)
        address owner;
    }

    // State variables
    uint256 public nextCreditId;
    mapping(uint256 => Credit) public credits;
    mapping(address => uint256[]) public ownerCredits;

    // Events
    event CreditIssued(uint256 creditId, address owner, uint256 amount, string description);
    event CreditTransferred(uint256 creditId, address from, address to);

    // Issue a new carbon credit
    function issueCredit(string memory description, uint256 amount) public {
        require(amount > 0, "Amount must be greater than 0");

        uint256 creditId = nextCreditId++;
        Credit memory newCredit = Credit({
            id: creditId,
            description: description,
            amount: amount,
            owner: msg.sender
        });

        credits[creditId] = newCredit;
        ownerCredits[msg.sender].push(creditId);

        emit CreditIssued(creditId, msg.sender, amount, description);
    }

    // Transfer carbon credit to another address
    function transferCredit(uint256 creditId, address to) public {
        require(to != address(0), "Invalid address");
        Credit storage credit = credits[creditId];
        require(credit.owner == msg.sender, "Only the owner can transfer this credit");

        // Remove credit from current owner's list
        _removeCreditFromOwner(creditId, msg.sender);

        // Assign credit to new owner
        credit.owner = to;
        ownerCredits[to].push(creditId);

        emit CreditTransferred(creditId, msg.sender, to);
    }

    // Get credit details
    function getCredit(uint256 creditId) public view returns (string memory, uint256, address) {
        Credit storage credit = credits[creditId];
        return (credit.description, credit.amount, credit.owner);
    }

    // Internal function to remove credit from an owner's list
    function _removeCreditFromOwner(uint256 creditId, address owner) internal {
        uint256[] storage creditList = ownerCredits[owner];
        for (uint256 i = 0; i < creditList.length; i++) {
            if (creditList[i] == creditId) {
                creditList[i] = creditList[creditList.length - 1];
                creditList.pop();
                break;
            }
        }
    }
}

